import Journal from "../images/journal.jpg"
import Book from "../images/book.jpg";
import Project from "../images/project.jpg"


export const ResearchData = [

  {
    image: Journal,
    heading: "Published Articles",
    paragraph: "You have free access to some of the articles published by LisaConsult",
    articles : {
        article1: <a href="">Relationship between Organizational Climate, Employee Psychological Empowerment, and Innovation</a>,
        article2: <a href="">Top Management Team Demographic Diversities, Generic Strategy and Firm Performance</a>,
        article3: ""
    }
  },

  {
    image: Book,
    heading: "Books",
    paragraph: "Some of the books, which are ready to be published are:",
    articles : {
        article1: "Success is a Matter of Personal Choice",
        article2: "Security Investment",
        article3: "Stress Management Strategies"
    }
  },

  {
    image: Project,
    heading: "Research Projects",
    paragraph: "Research is the basis for solutions, success, satisfaction, happiness and health.",
    articles : {
        article1: "Eritrean refugees stress-coping Strategies and Psychological well-being",
        article2: "National Reconciliation",
        article3: "Strategic Leadership"
    }
  },

];
